import React from 'react';
import './style.css'




const ThirdArticle = (text, Img, Img2, Img3) => {
    return (

        <div className="container">

            <p>{text}</p>

            <div className="third-article">


                <article className="third-article">


                    <img className="third-article-thumb" src={Img} alt="Mario news" />


                    <img className="third-article-thumb" src={Img2} alt="Fifa news" />

                    <img className="third-article-thumb" src={Img3} alt="PUBG news" />

                </article>

            </div>
            <hr />

        </div>


    );
}

export default ThirdArticle;
